import React, { Component } from "react";
import { MainHeader } from "../Components/MainBackground";


class ParentPortal extends Component {
  render() {
    return (
      <MainHeader>
        <h2>ParentPortal</h2>
      </MainHeader>
    );
  }
}

export default ParentPortal;
